import React from "react";
import SkillCard from "./SkillCard"

const frontend = {
  name:'Frontend Stack',
  skills:['JavaScript','React/Redux','Sass','Bootstrap']
}
const backend = {
  name: "Backend Stack",
  skills: ['Python', 'Django', 'AWS', 'PostgreSQL']
}
const gameDev = {
  name:"Development Tool",
  skills:['Unity','Phaser','PyGame']
}

function SkillList() {
  return (
    <>
      <section id="skills">
        <div className="container">
          <h2 className="section-title">Skills</h2>
          <div className="row skills-wrapper">
          <SkillCard title="Front-end" skills={["React","JavaScript","Sass","Bootstrap"]}/>
          <SkillCard title="Back-end" skills={["Nodejs","Laravel",".NETCore","MongoDB"]}/>
          <SkillCard title="Tools" skills={["Git","Aws"]}/>
          </div>
        </div>
      </section>

    </>
  );
}

export default SkillList;
